Defendant Jb Hankins in court with attorney Kristian Kanekoa Lindo.  Defendant Jb Hankins in custody.  Deann L Heard appeared for the State of Wisconsin.  Sentencing proceeded.  Statements by the State, defense and defendant.  Additional statements by:  The Court imposed the following sentence:   

AS TO COUNT 01:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 3 years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 18 months.  Defendant shall serve 18 months on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program, but not for  the Wisconsin Substance Abuse Program.  
 * DNA sample previously taken.

AS TO COUNT 02:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years  consecutive to Count 1.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for two (2) years.  Defendant shall serve two (2) years on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program, but not for  the Wisconsin Substance Abuse Program.  

AS TO COUNT 03:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years consecutive to Count 2.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for two (2) years..  Defendant shall serve two (2) years  on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program, but not for the Wisconsin Substance Abuse Program.  

AS TO COUNT 04:
The Defendant's TOTAL LENGTH OF SENTENCE shall be 4 years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for two (2) years.  Defendant shall serve two (2) years   on EXTENDED SUPERVISION.  The defendant is eligible for the Challenge Incarceration Program, but not for  the Wisconsin Substance Abuse Program.  

The Court advised the defendant of the determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant.   

AS TO COUNTS 1 - 4:
Court ordered defendant to pay restitution as follows:  $237.85 to George Webb restaurant; $350.00 to Poor Richards; $1,000.69 to 7-11; $1,599.92 to TJ Maxx to be paid first.  Then, defendant must pay the DNA surcharges, plus costs and disbursements.  Court ordered all monies to be taken by the Department of Corrections from up to 25% of prison funds.  Balance to be paid while on Extended Supervision.

CONDITIONS OF EXTENDED SUPERVISION:
 - No contact with Walgreens at 4296 South 76th Street, Greenfield, Wisconsin; George Webb restaurant located at 3133 South 92nd Street, Milwaukee, Wisconsin; Poor Richards located at 10731 West Oklahoma Avenue, West Allis, Wisconsin; 7-11 store at 3301 North Oakland Avenue, Milwaukee, Wisconsin; TJ Maxx at 4200 South 76th Street, Greenfield, Wisconsin; Angelica N., Amber W., Amanda C. or Kai C.;
 - Undergo a mental health evaluation; undergo any treatment recommended;
 - No controlled substances other than those legally prescribed by a duly licensed physician for his mental or physical needs; take only as prescribed and only for as long as deemed medically reasonable and necessary;
 - No alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  
- Court ordered defendant to pay any balances remaining of the restitution,  costs, surcharges and disbursements.  Failure to pay amounts in full would result in a civil judgment entered against defendant.

 * Restitution at zero as to Count 1, as none was requested.

